    return (
        <div className = "videoCard">
            <img
                src={`${base_url}${movie.backdrop_path}`} alt="movie poster"
            />
            <p>{}</p>
            <h2>Movie Title</h2>
            <p>Number if likes...</p>
        </div>
    )
}

export default Videocard
